interface Props{
    visible: boolean;
    score: number;
    correctQuestions:number;
    questionLength:number | undefined;
}
export default function QuizResult(props: Props){
    const { visible, score, correctQuestions, questionLength } = props
    return (
        <>
            {visible && 
                <div className="flex justify-center ">
                    <div className="text-3xl">Your Score : {score}</div><br />
                    <div className="text-3xl">You got  : {correctQuestions}/{questionLength}</div>
                </div>
            }
        </>
    )
}
